const t=JSON.parse('{"key":"v-2d0ad528","path":"/zh/","title":"","lang":"简体中文","frontmatter":{"home":true,"heroImage":"https://cxrs.xyz/upload/2023/07/13/13c4dd93-623c-47b7-81b8-892541e23315.jpg","actions":[{"text":"快速上手","link":"/note","type":"secondary"},{"text":"关于","link":"/zh/about/","type":"secondary"}],"features":[{"title":"蔡徐坤","details":"中国内地男歌手、演员、原创音乐制作人和舞者。他曾参加过多个音乐节目和选秀比赛，并在2018年的中国音乐界引起了广泛的关注。他的音乐风格以嘻哈、电子和流行音乐为主，同时也有一些实验性的音乐作品。"},{"title":"陈立农","details":"中国台湾男歌手、演员，出生于2001年。他因参加中国台湾的音乐选秀节目《偶像练习生》而开始走红，并在节目中获得了第二名的好成绩。他的音乐风格以流行和R&B为主，也有一些歌曲是关于青春和成长的。"},{"title":"范丞丞","details":"中国内地男歌手、演员，出生于2000年。他是范冰冰的弟弟，因参加中国大型音乐选秀节目《偶像练习生》而开始受到关注。他的音乐风格以流行和电子为主，同时也有一些歌曲表达了他对时尚和潮流的追求。"},{"title":"黄明昊","details":"中国内地男歌手、演员，出生于2002年。他也是《偶像练习生》出身，获得了第三名的好成绩。他的音乐风格以流行和嘻哈为主，也有一些歌曲是关于梦想和青春的。"},{"title":"林彦俊","details":"中国台湾男歌手、演员，出生于1999年。他曾参加过多个音乐比赛和选秀节目，并在《偶像练习生》中获得了第五名的好成绩。他的音乐风格以流行和R&B为主，同时也有一些歌曲表达了他对生活的感悟和态度。"},{"title":"朱正廷","details":"中国内地男歌手、演员、舞者，出生于1996年。他曾是中国舞蹈团的成员之一，并在多个舞蹈比赛中获得了冠军。他参加了《偶像练习生》，并最终在该节目中获得了第六名。他的音乐作品以流行和电子为主，同时也有一些歌曲是关于梦想和挑战的。"},{"title":"王子异","details":"中国内地男歌手、演员，出生于1996年。他也是《偶像练习生》出身，在该节目中获得了第七名。他的音乐风格以流行和R&B为主，同时也有一些歌曲是关于友情和成长的。"},{"title":"尤长靖","details":"中国内地男歌手、演员，出生于1994年。他曾在马来西亚参加过多个歌唱比赛，并在2017年发行了个人首张专辑《柚柚》。他的音乐作品以流行和电子为主，同时也有一些歌曲是关于情感和人生的。"}],"footer":"Power By LiuYuPei<liu_yupei@foxmial.com>"},"headers":[],"git":{"updatedTime":1696090710000,"contributors":[{"name":"“Mortal-Tianya”","email":"Tianya-68@qq.com","commits":1}]},"filePathRelative":"zh/README.md"}');export{t as data};
